import * as style from "../../css/light/phoneListContainer"

export default function ProfileListItem({data}) {

  const convertData = () => {
    let temp = []
  
    Object.keys(data).slice(1).forEach((item, i) => {
      temp.push(data[i]['data'])
    })
  
    return temp
  }


  const renderListDataMain = () => {
    return <div style={style.phoneListContainerMAC}>
      {data[0]['data']}
    </div>
  }

  const renderListDataOther = () => {
    let temp = convertData()
    return temp.map((item, i) => (
      <li style={style.phoneListContainerItem}>{item}</li>
    ))
  }

  return (
    <div style={style.phoneListContainer}>
      {renderListDataMain()}
      <div style={style.phoneListContainerInfo}>
        <ul style={style.phoneListContainerItems}>
          {renderListDataOther()}
          {/* <li style={style.phoneListContainerItem}>{props.item2}</li>
          <li style={style.phoneListContainerItem}>{props.item3}</li>
          <li style={style.phoneListContainerItem}>{props.item4}</li>
          <li style={style.phoneListContainerItem}>{props.item5}</li>
          <li style={style.phoneListContainerItem}>{props.item6}</li>
          <li style={style.phoneListContainerItem}>{props.item7}</li> */}
        </ul>
      </div>
    </div>
  )
}
